import react from "react"

export default function ProductFilter({src,title,price,highlights,wishlist}){

    return (
        <div className="product-filter">
            <div className="categories-filter">
                <input type="radio" id="huey" name="categories" value="huey" checked/> <label>Graphics Card</label>
                <input type="radio" id="huey" name="categories" value="huey" checked/> <label>Proccessor</label>
                <input type="radio" id="huey" name="categories" value="huey" checked/> <label>Storage</label>
            </div>
        </div>
    )
   
}
